class AssignPipette {
  constructor(transfer_vol, eight_tips, change_tips){
    this.transfer_vol = transfer_vol;
    this.eight_tips = eight_tips;
    this.change_tips = change_tips;
  }
}
var liquid1 = new AssignPipette(100, 'Yes', 'No');


function FindPipette(liquid){
  let vol = liquid.vol_per_multiplier*liquid.multiplier/1000;

  if (liquid.transfer_vol <= 20){
    if (liquid.eight_tips == 'Yes'){
      return('rP20 Single Channel Pipette')
    }
    else {
      return('rP20 Multi-Channel Pipette')
    }
  }

  else if (liquid.transfer_vol >= 20){
    if (liquid.eight_tips == 'Yes'){
      return('rP300 Single-Channel Pipette')
    }
    else {
      return('rP300 Multi-Channel Pipette')
    }
  }

  else{
    return('rP1000 Single-Channel Pipette')
  }
}
